import React from "react";
import { SortableContainer } from "react-sortablbe-hoc";
import List from "@material-ui/core/List";
import Divider from "@material-ui/core/Divider";
import Todo from "./Todo";

export default function DraggableTodoList(props) {
  return (
    <div>
      <List>
        {props.posts.map((todo, i) => (
          <React.Fragment key={i}>
            <Todo {...todo} key={todo._id} />
            {i < props.posts.length - 1 && <Divider />}
          </React.Fragment>
        ))}
      </List>
    </div>
  );
}
